export function Render()
{

    if(savedLayout != layout){
        InitScanCodes();
    }

var packet = [];
packet[0x00]           = 0x00;
packet[0x01]           = 0x07;
packet[0x02]           = 0x25;
packet[0x03]           = 0x00;
packet[0x04]           = 0x00;


    for(var iIdx = 0; iIdx < vKeyPositions.length; iIdx++)
    {
        var iPxX = vKeyPositions[iIdx][0];
        var iPxY = vKeyPositions[iIdx][1];
        var mxPxColor = device.color(iPxX, iPxY);
        packet[0x05+iIdx*3] = mxPxColor[0];
        packet[0x05+iIdx*3 +1 ] = mxPxColor[1];
        packet[0x05+iIdx*3 +2 ] = mxPxColor[2];
    }
    device.write(packet,65)

}

export function Validate(endpoint)
{
    return endpoint.interface === 1;
}

function sendPacketString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[i] = parseInt(data[i],16)//.toString(16)
    }

    device.write(packet, size);
}
function sendReportString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[i] = parseInt(data[i],16)//.toString(16)
    }

    device.send_report(packet, size);
}
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
  }
